package main

import (
	"fmt"
	"time"
)

const (
	message = ""
)

func main() {
	begin := time.Now()
	queue := NewQueue([]rune(message[0:14]))

	for _, char := range message[14:] {
		if queue.IsQueueUnique() {
			break
		}
		queue.Enqueue(char)
	}

	fmt.Println(time.Now().Sub(begin))
	fmt.Println(queue.Count())
}
